class Solution {
  int countKSubsequencesWithMaxBeauty(String s, int k) {
    const int mod = 1000000007;
    final Map<String, int> freq = {};
    for (int i = 0; i < s.length; i++) {
      freq[s[i]] = (freq[s[i]] ?? 0) + 1;
    }
    List<int> counts = freq.values.toList();
    counts.sort((a, b) => b.compareTo(a));

    if (k > counts.length) return 0;

    int maxBeauty = counts.take(k).reduce((a, b) => a + b);
    List<List<int>> choose = List.generate(counts.length + 1,
        (i) => List.generate(k + 1, (j) => 0));
    for (int i = 0; i <= counts.length; i++) {
      choose[i][0] = 1;
      for (int j = 1; j <= k && j <= i; j++) {
        choose[i][j] = (choose[i - 1][j] + choose[i - 1][j - 1]) % mod;
      }
    }

    int result = 0;
    for (int i = 0; i < counts.length; i++) {
      if (counts[i] >= k) {
        result = (result + choose[counts[i]][k]) % mod;
      }
    }

    return result;
  }
}
